class Costanti {

    static get ALL() {
        return "all";
    }

    static get PARTENZA() {
        return "Partenza";
    }

    static get ARRIVO() {
        return "Arrivo";
    }

    static get DURATA() {
        return "Durata";
    }

    static get TRENO() {
        return "Treno";
    }

    static get ORE() {
        return "Ore";
    }

    static get DA() {
        return "Da";
    }

    static get A() {
        return "A";
    }

}

export default Costanti;
